The Assemetquagan River is a freshwater river in the Matapedia Valley, in Quebec, in Canada. Its water source lies within the Notre Dame Mountains, while it ends by flowing into the Matapedia River 20 kilometres (12 mi) North by Northwest of Matapédia, Quebec. . This river runs through the regional county municipalities (RCM): 
*  Avignon Regional County Municipality (in administrative region Gaspésie-Îles-de-la-Madeleine): unorganized territory of New River: Fauvel (township); and municipality of Saint-André, New Brunswick in Restigouche County; 
*  La Matapedia Regional County Municipality (in administrative region of Bas-Saint-Laurent): unorganized territory of Routhierville, Quebec: Assemetquagan (township). The Assemetquagan river rises in the section of Chic-Choc Mountains (part of the Notre Dame Mountains) and flows into the Matapedia River in 20 kilometres (12 mi) of Matapedia, Quebec. The river is part of the tourist region of Gaspésie in the tourist sub-region of Matapedia Valley.
